import React from "react";
import Typical from "react-typical";

const Logo = (props) => {
  return (
    <div className={props.style}>
      <h2>
        Hi, I am{" "}
        <Typical loop={Infinity} wrapper="b" steps={["Xinyu Tang , ", 1]} />
        <Typical
          loop={Infinity}
          wrapper="b"
          steps={[" aspiring web developer", 1000, "software engineer", 1000]}
        />
      </h2>
    </div>
  );
};

export default Logo;
